    "2015-04-25T12:20:16.993840",nt"name": "fire-history51a34",nt"isopen":
    false,nt"url": null,nt"notes": "The Fire Perimeters data consists of CDF
    fires 300 acres and greater in size and USFS fires 10 acres and greater throughout
    California from 1950 to 2002. Some fires before 1950, and some CDF fires smaller
    than 300 acres are also included. In 2002 CDF's criteria expanded to include timber
    fires 10 acres and greater, brush fires 50 acres and greater, and grass fires 300
    acres and greater, wildland fires destroying three or more structures, and wildland
    fires causeing $300,000 or more in damage. Also in 2002 BLM and NPS joined the effort,
    collecting fires10 acres and greater. So far only Sequoia-Kings Canyon and Yosemite
    National Parks have turned in data from NPS, and BLM has only turned in 2002 fires.",nt"license_title":
